import { StatusBar } from "expo-status-bar";
import React, { useEffect } from "react";
import { StyleSheet, Text, View, TouchableOpacity } from "react-native";

import RNNexgoPrinter, {
  alignEnum,
  fontEnum,
  printArrayTypeEnum,
} from "./module";
import moment from "moment";

const img =
  "";

export default function App() {
  useEffect(() => {
    (async () => {
      try {
        const init = await RNNexgoPrinter.init();
      } catch (e) {
        console.log("ERROR", e);
      }
    })();
  }, []);

  const print = async () => {
    try {
      const dateObj = moment().format("DD.MM.YYYY HH:mm:ss");

      await RNNexgoPrinter.print([
        {
          type: printArrayTypeEnum.IMG,
          string: img,
          align: alignEnum.CENTER,
          imgWidth: 200,
          imgHeight: 200,
        },
        { type: printArrayTypeEnum.EMPTY },

        {
          string: "BINGO",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontEntity: fontEnum.BOLD,
        },
        {
          string: "PJ.15",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
        },
        {
          string: "Dzidzikovac 6",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
        },
        {
          string: "71000, Sarajevo",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
        },
        {
          string: dateObj.toString(),
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
        },
        { type: printArrayTypeEnum.EMPTY },
        {
          string: "POTVRDA O ISKORISTENOM \n SALJI KUPONU",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 30,
        },
        { type: printArrayTypeEnum.EMPTY },
        {
          string: "120.45 BAM",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 35,
          fontEntity: fontEnum.BOLD,
        },
        { type: printArrayTypeEnum.EMPTY },

        {
          string: "Broj kupona",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 30,
        },
        {
          string: "1234 1234 1234",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 35,
        },
        { type: printArrayTypeEnum.EMPTY },

        {
          string: "Transakcija",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 30,
        },
        {
          string: "1wesaa234sdad43dsaa21",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 35,
        },
        { type: printArrayTypeEnum.EMPTY },
        { type: printArrayTypeEnum.EMPTY },

        {
          string: "www.salji.org",
          type: printArrayTypeEnum.TEXT,
          align: alignEnum.CENTER,
          fontSize: 35,
        },
      ]);
    } catch (e) {
      console.log("ERROR", e);
    }
  };

  return (
    <View style={styles.container}>
      <Text>Open up App.js to start working on your app!</Text>
      <TouchableOpacity
        onPress={print}
        style={{ backgroundColor: "blue", padding: 10 }}
      >
        <Text style={{ color: "#fff" }}> PRINT </Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
